FullDescriptions:
Shine Systems is seeking a mid to senior level Data Analyst with Python experience for our client in Atlanta, GA.


REQUIRES US CITIZENSHIP AND WILL NEED TO GO THROUGH THE PUBLIC TRUST BACKGROUND CHECK.

Seeking candidates with 5+ years of experience in data management and data visualization with a background in Python and PySpark. Demonstrated experience with requirements gathering, project management, user support and new customer implementation preferred.

Candidate will work at the CDC in support of a contract entitled DCIPHER DATA COLLATION AND INTEGRATION FOR PUBLIC HEALTH EVENT RESPONSES SUPPORT SERVICES (DCIPHER). The position will integrate data into the Palantir platform called “Foundry.”

Candidate will provide support in the following areas:

Project Management;
Software Testing & Quality Assurance Services;
Technical Writing/Training Services;
Help Desk and User Support Services;
Report Writing Services; and
Business Analysis and Workflows Services;
Software Development Services;
Software Design and Architecture Review Process;
Agile Software Design and Development Methodology;
Software Releases and Deployment;
Software Delivery and Acceptance;
Application Documentation;
Integration with Other Contractor Efforts;
Technical Support Services;
Project Management / Software Development Lifecycle Deliverables; and
Quality Assurance



Required Skills
Skills required are: Java, Python pandas, Spark SQL, YAML, CSS, and Spark R. US Citizenship
Required Experience

Requirement:
Minimum education and experience: Master's Degree (MA, MS or MPH) in epidemiology, public health or related field; one year of applied experience beyond terminal degree.
Familiarity with programming with Rand Python software, including use of Python's Scikit-leam library;
Knowledge of epidemiologic modeling and tests of statistical significance, including regression;
Experiencing with building machine learning models and validating models;
Familiarity with social media (e.g., Facebook, Twitter, Instagram) and text based data;
Experiencing employing geospatial data management techniques;
Ability to communicate in oral and written forms.
